import com.eviware.soapui.support.XmlHolder
def response = context.testCase.getTestStepByName("Save Customer").getPropertyValue("response")
def holder = new XmlHolder(response)
def customerid = holder.getNodeValue("//*:id")
context.testCase.setPropertyValue("customerid", customerid)

con:config.script:
import jxl.*
def username, password
def filepath = "C:\\Users\\KunalRaool\\Desktop\\SDET\\SOAPUI project\\Project\\SOAP Project\\Data.xls"
File myfile = new File(filepath)
Workbook workbook = Workbook.getWorkbook(myfile)
Sheet sheet = workbook.getSheet("Sheet1")
def row = sheet.getRows().toInteger()
log.info "The number of rows are " + row
def column = sheet.getColumns().toInteger()

for (i=1; i<row; i++)
{
	def email = sheet.getCell(0,i).getContents()
	def firstname = sheet.getCell(1,i).getContents()
	def lastname = sheet.getCell(2,i).getContents()
	def testcase = testRunner.testCase.testSuite.testCases["Create and Delete Customer"]
	testcase.testSteps["Properties"].setPropertyValue("email", email)
	testcase.testSteps["Properties"].setPropertyValue("firstname", firstname)
	testcase.testSteps["Properties"].setPropertyValue("lastname", lastname)

	def runner = testcase.run(null, false)
	log.info "The Status is $runner.status"
	log.info "Time taken is $runner.timeTaken ms"
	log.info "Number of Steps executed is "+ runner.results.size()
	assert runner.results.size()== 6


}

